webpackJsonp([0xfeec34856c4c],{1991:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-06-18-gave-up-on-road-bike-going-off-road-with-santa-cruz-blur-xc/index.md absPath of file >>> MarkdownRemark",html:'<p>Too much research can fry one\'s brain. I have been looking for a new road bike forever. In the meantime my lust for the dirt has been growing so I bought a new <a href="http://www.santacruzmtb.com/blurxc/">Blur XC with SRAM X0</a>. Once upon a time I spent a lot of time on a mountain bike. That was a decade ago. The Blur XC is amazing. I have only ridden it for a short period of time, but it is awesome. More after I take it in the hills.</p>',frontmatter:{title:"Gave up on Road Bike, Going off Road with Santa Cruz Blur XC",date:"June 18, 2007",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{}}}});
